import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Authenticator} from 'aws-amplify-react';



function App() {
  return (
    <div className="App">
      <h1>Inner App</h1>
    </div>
  );
}

export default withAuthenticator(App, false, [
  <CustomSignIn/>,
  <CustomSignUp/>
] 
);
